    if(props.release_date!==null){
        console.log(realeaseDate);
        realeaseDate = new Date(realeaseDate.substr(0,19));
    }
    const nowDate = new Date();
    var diff = (nowDate.getTime() - upLoadDate.getTime())/(1000*60*60*24);


