                    <div className="DP_uploadTime">upload.date / {parseInt(diff)+'일 전'}</div>
                    <div className="DP_releaseTime">release.date / {props.release_date}</div>
                </div>
            </div>
        </div>
    </div>
    );
}

export default RecentInfoListCard
